import {Box} from "@mui/material";
import ProjectCardWithContent from "./ProjectCardWithContent";
import CardSiftFrontendDev
    from "./projects/SiftFrontendDev/CardSiftFrontendDev";
import React from "react";
import winnoImg from "./projects/IterativeDesign/asset/intro-image.jpeg";
import poshmarkImg from "./projects/ResponsiveRedesign/asset/Poshmark-intro.png"

interface ProjectCardProps {
    index: number
    setWhichPage: React.Dispatch<React.SetStateAction<string>>
}

const iterativeDesignContent = {
    title: "Iterative Redesign: Winno",
    pageName: "project0",
    description: "Lorem ipsum dolor sit amet consectetur adipisicing elit. Maxime\n" +
        "                mollitia,\n" +
        "                molestiae quas vel sint commodi repudiandae consequuntur\n" +
        "                voluptatum laborum\n" +
        "                numquam blanditiis harum quisquam eius sed odit fugiat iusto\n" +
        "                fuga praesentium\n" +
        "                optio, eaque rerum! Provident similique accusantium nemo autem.",
    image: winnoImg
}

const responsiveRedesignContent = {
    title: "Responsive Redesign: Poshmark",
    pageName: "project1",
    description: "Lorem ipsum dolor sit amet consectetur adipisicing elit. Maxime\n" +
        "                mollitia,\n" +
        "                molestiae quas vel sint commodi repudiandae consequuntur\n" +
        "                voluptatum laborum\n" +
        "                numquam blanditiis harum quisquam eius sed odit fugiat iusto\n" +
        "                fuga praesentium\n" +
        "                optio, eaque rerum! Provident similique accusantium nemo autem.",
    image: poshmarkImg
}

const siftContent = {
    title: "Frontend Development: Sift",
    pageName: "project2",
    description: "Lorem ipsum dolor sit amet consectetur adipisicing elit. Maxime\n" +
        "                mollitia,\n" +
        "                molestiae quas vel sint commodi repudiandae consequuntur\n" +
        "                voluptatum laborum\n" +
        "                numquam blanditiis harum quisquam eius sed odit fugiat iusto\n" +
        "                fuga praesentium\n" +
        "                optio, eaque rerum! Provident similique accusantium nemo autem.",
    image: winnoImg
}


export default function ProjectCard(props: ProjectCardProps) {

    let project;
    switch (props.index) {
        case 0:
            project =
                <ProjectCardWithContent setWhichPage={props.setWhichPage}
                                        description={iterativeDesignContent.description}
                                        image={iterativeDesignContent.image}
                                        pageName={iterativeDesignContent.pageName}
                                        title={iterativeDesignContent.title}/>
            break;
        case 1:
            project = <ProjectCardWithContent setWhichPage={props.setWhichPage}
                                              description={responsiveRedesignContent.description}
                                              image={responsiveRedesignContent.image}
                                              pageName={responsiveRedesignContent.pageName}
                                              title={responsiveRedesignContent.title}/>
            break;
        case 2:
            project = <ProjectCardWithContent setWhichPage={props.setWhichPage}
                                              description={siftContent.description}
                                              image={siftContent.image}
                                              pageName={siftContent.pageName}
                                              title={siftContent.title}/>
            break;
        default:
            project =
                <Box>
                    Not Implemented yet
                </Box>
    }
    return project;
}
